(5007, 264, '_services_heading_right', 'field_644eff7173d78'),
(5008, 264, 'services_text_left', 'We provide hassle-free residential moving services to make your transition to your new home smooth and stress-free. Our team of professionals will pack, load, and transport your belongings with care and precision.'),
(5009, 264, '_services_text_left', 'field_644f300f02f08'),
(5010, 264, 'services_text_right', 'We offer reliable and efficient commercial moving services for businesses of all sizes. Our team will work with you to create a customized moving plan that meets your specific needs and minimizes downtime.'),
(5011, 264, '_services_text_right', 'field_644f302702f09'),
(5012, 264, 'services_image_left_1', ''),
(5013, 264, '_services_image_left_1', 'field_644f31407be9c'),
