(7059, 275, '_testimonials_home_main_heading', 'field_644f39166a40d'),
(7060, 275, 'testimonials_home_text_home', 'I recently moved to a new city and hired Packers and Movers to help with the move. From start to finish, the team was incredibly professional and made the entire process stress-free. They arrived on time, packed all of my belongings with care, and transported everything to my new home safely and efficiently. I was particularly impressed with their attention to detail and the extra steps they took to ensure that everything was done to my satisfaction. '),
(7061, 275, '_testimonials_home_text_home', 'field_644f35668ff47'),
(7062, 275, 'testimonials_home_text_home1', 'I recently used the services of Packers and Movers for my office relocation and I was extremely impressed with the level of service provided. The team was punctual, efficient, and handled all of our equipment with great care. They went above and beyond to ensure that everything was safely transported to our new location and even helped with the unpacking process.'),
(7063, 275, '_testimonials_home_text_home1', 'field_644f35668ff48'),
(7064, 275, 'testimonials_home_text_home2', 'I recently used the services of Packers and Movers for my home relocation. The movers arrived on time and were extremely professional and courteous throughout the entire process. They took great care in packing and transporting my belongings, ensuring that everything arrived at my new home in perfect condition. I was particularly impressed with their attention to detail and willingness to go above and beyond to make sure everything was done to my satisfaction.'),
