(7479, 277, '_testimonials_home_main_heading', 'field_644f39166a40d'),
(7480, 277, 'testimonials_home_text_home', 'I recently moved to a new city and hired Packers and Movers to help with the move. From start to finish, the team was incredibly professional and made the entire process stress-free.'),
(7481, 277, '_testimonials_home_text_home', 'field_644f35668ff47'),
(7482, 277, 'testimonials_home_text_home1', 'I recently used the services of Packers and Movers for my office relocation and I was extremely impressed with the level of service provided. '),
(7483, 277, '_testimonials_home_text_home1', 'field_644f35668ff48'),
(7484, 277, 'testimonials_home_text_home2', 'I recently used the services of Packers and Movers for my home relocation. The movers arrived on time and were extremely professional and courteous throughout the entire process. They took great care in packing and transporting my belongings, ensuring that everything arrived at my new home in perfect condition. I was particularly impressed with their attention to detail and willingness to go above and beyond to make sure everything was done to my satisfaction.'),
