(8422, 283, 'services_heading_left_1', 'Packing and Unpacking'),
(8423, 283, '_services_heading_left_1', 'field_644f316d7be9e'),
(8424, 283, 'services_heading_right_1', 'Loading and Unloading'),
(8425, 283, '_services_heading_right_1', 'field_644f317f7be9f'),
(8426, 283, 'services_text_left_1', 'Our packing and unpacking services ensure that your belongings are carefully packed and protected during transit. We also offer unpacking services to help you get settled into your new home or office quickly.'),
(8427, 283, '_services_text_left_1', 'field_644f318f7bea0'),
(8428, 283, 'services_text_right_1', 'Our team of professionals is trained to safely and efficiently load and unload your belongings, minimizing the risk of damage and ensuring a smooth move.'),
(8429, 283, '_services_text_right_1', 'field_644f319c7bea1'),
(8430, 283, 'services_image_left_2', ''),
(8431, 283, '_services_image_left_2', 'field_644f328824ef5'),
