(8434, 283, 'services_heading_left_2', 'Storage Solutions'),
(8435, 283, '_services_heading_left_2', 'field_644f32a624ef7'),
(8436, 283, 'services_heading_right_2', 'Long-Distance Moving'),
(8437, 283, '_services_heading_right_2', 'field_644f32ab24ef8'),
(8438, 283, 'services_text_left_2', 'We offer secure storage solutions for your belongings during your move or for long-term storage. Our facilities are equipped with state-of-the-art security measures to ensure that your belongings are safe and protected.'),
(8439, 283, '_services_text_left_2', 'field_644f32b124ef9'),
(8440, 283, 'services_text_right_2', 'We offer long-distance moving services to help you relocate to a new state or even across the country. Our team will work with you to create a customized moving plan and ensure that your belongings arrive safely and on time.'),
(8441, 283, '_services_text_right_2', 'field_644f32b624efa'),
(8442, 283, 'testimonials_text_1', ' I recently moved to a new city and hired Packers and Movers to help with the move. From start to finish, the team was incredibly professional and made the entire process stress-free. '),
(8443, 283, '_testimonials_text_1', 'field_6449b47c5c498'),
(8444, 283, 'testimonials_text_2', ' I recently used the services of Packers and Movers for my office relocation and I was extremely impressed with the level of service provided. '),
(8445, 283, '_testimonials_text_2', 'field_6449b4955c499'),
(8446, 283, 'testimonials_text_3', ' I recently used the services of Packers and Movers for my home relocation. The movers arrived on time and were extremely professional and courteous throughout the entire process. '),
