(9776, 309, '_testimonials_page_top_heading', 'field_645cbd002c460'),
(9777, 309, 'testimonials_page_text', 'It was an amazing experience with Auckland Packers n Movers. We have moved a lot in Auckland and ech time books their revivalists services. Starting with their pre-move service, they surveyed our home furniture and listed down our needs. They loaded our property with the utmost care as if it would theirs. I am satisfied with the choice of vehicles they used to locate my stuff. Our belongings were safely moved. They did a post move cleaning of our new house as well and arranged our furniture as per our command. I am 100% satisfied with the Auckland Packers n Movers, I would highly recommend it to everyone.'),
(9778, 309, '_testimonials_page_text', 'field_645cbd1b2c461'),
(9779, 309, 'testimonials_page_name', 'Masson Walsh'),
(9780, 309, '_testimonials_page_name', 'field_645cbd2a2c462'),
(9781, 309, 'testimonials_page', ''),
(9782, 309, '_testimonials_page', 'field_645cbc8d9cff9'),
(9783, 296, 'testimonials_page_top_heading_1', ''),
(9784, 296, '_testimonials_page_top_heading_1', 'field_645d68273945e'),
(9785, 296, 'testimonials_page_text1', 'Your dedication to providing outstanding customer service is evident in everything you do and I am truly grateful for your help. Thanks to your expertise and guidance, I feel confident that I have chosen right packers and movers to shift my baggage.'),
(9786, 296, '_testimonials_page_text1', 'field_645d685439460'),
(9787, 296, 'testimonials_page_name_1', 'Shikhashree'),
(9788, 296, '_testimonials_page_name_1', 'field_645d686139461'),
(9789, 296, 'testimonials_page_top_heading_2', ''),
(9790, 296, '_testimonials_page_top_heading_2', 'field_645d687339462'),
(9791, 296, 'testimonials_page_text_2', 'We would just like to say a big Thankyou to the three men employed by your firm, who to transported our furniture from Aorangi Place in Birkenhead Auckland to Maddison place in Welcome Bay Tauranga on Tuesday 5th of May. They were friendly, courteous and worked quickly and carefully. It was much appreciated by us and we would like you to pass on our\r\nthanks to them.'),
(9792, 296, '_testimonials_page_text_2', 'field_645d687a39463'),
(9793, 296, 'testimonials_page_name_2', 'Ray & Jan Mansell'),
