(9874, 316, '_testimonials_page_top_heading', 'field_645cbd002c460'),
(9875, 316, 'testimonials_page_text', 'It was an amazing experience with Auckland Packers n Movers. We have moved a lot in Auckland and ech time books their revivalists services. Starting with their pre-move service, they surveyed our home furniture and listed down our needs. They loaded our property with the utmost care as if it would theirs. I am satisfied with the choice of vehicles they used to locate my stuff. Our belongings were safely moved. They did a post move cleaning of our new house as well and arranged our furniture as per our command. I am 100% satisfied with the Auckland Packers n Movers, I would highly recommend it to everyone.'),
