(9987, 317, 'testimonials_page_text_2', 'We would just like to say a big Thankyou to the three men employed by your firm, who to transported our furniture from Aorangi Place in Birkenhead Auckland to Maddison place in Welcome Bay Tauranga on Tuesday 5th of May. They were friendly, courteous and worked quickly and carefully. It was much appreciated by us and we would like you to pass on our\r\nthanks to them.'),
